import React from 'react';
import { Switch, Route, Link, useLocation, Redirect, useHistory} from "react-router-dom";
import { Avatar, Spin, Button } from 'antd';
import './styles.css'

const Login = () => {
    const history = useHistory()
    const handleLogin = (e) => {
        history.push('/overview')
    }
    return ( 
        <div style={{background:'#2f3136', height:'100vh', display:'flex', flexDirection:'column', justifyContent:'center', alignItems:'center', width:'100%'}}>
            <svg height="100%" width="100%" id="svg" viewBox="0 0 1440 600" xmlns="http://www.w3.org/2000/svg" class="transition duration-300 ease-in-out delay-150"><defs><linearGradient id="gradient"><stop offset="5%" stop-color="#002bdc88"></stop><stop offset="95%" stop-color="#32ded488"></stop></linearGradient></defs><path d="M 0,600 C 0,600 0,200 0,200 C 124.36363636363635,212.53588516746413 248.7272727272727,225.07177033492823 331,212 C 413.2727272727273,198.92822966507177 453.4545454545455,160.2488038277512 553,156 C 652.5454545454545,151.7511961722488 811.4545454545455,181.93301435406698 911,191 C 1010.5454545454545,200.06698564593302 1050.7272727272727,188.01913875598086 1129,186 C 1207.2727272727273,183.98086124401914 1323.6363636363635,191.99043062200957 1440,200 C 1440,200 1440,600 1440,600 Z" stroke="none" stroke-width="0" fill="url(#gradient)" class="transition-all duration-300 ease-in-out delay-150"></path><defs><linearGradient id="gradient"><stop offset="5%" stop-color="#002bdcff"></stop><stop offset="95%" stop-color="#32ded4ff"></stop></linearGradient></defs><path d="M 0,600 C 0,600 0,400 0,400 C 90.20095693779905,416.0382775119617 180.4019138755981,432.07655502392345 274,410 C 367.5980861244019,387.92344497607655 464.5933014354066,327.73205741626793 571,325 C 677.4066985645934,322.26794258373207 793.2248803827753,376.99521531100476 884,384 C 974.7751196172247,391.00478468899524 1040.5071770334928,350.2870813397129 1129,345 C 1217.4928229665072,339.7129186602871 1328.7464114832537,369.85645933014354 1440,400 C 1440,400 1440,600 1440,600 Z" stroke="none" stroke-width="0" fill="url(#gradient)" class="transition-all duration-300 ease-in-out delay-150"></path></svg>
            <div style={{background:'#3A3C41', borderRadius:'20px', height:'300px', width:'300px', display:'flex', flexDirection:'column', justifyContent:'center', alignItems:'center', boxShadow:'0px 0px 20px 1px #202225'}}>
                <div className="brand">
                    <img src="DanceOnLogo.svg" style={{height:'40px'}}/>
                    <div style={{marginLeft:'10px'}}>DANCE<span style={{fontWeight:'bold', color:'#5a65ea'}}>DANCE</span></div> 
                </div>
                <Button type="primary" onClick={handleLogin} >Login</Button>
            </div>
        </div>
     );
}

export default Login;
